    @staticmethod
    def plot():
        # LOAD DATASETS
        iris = GeoDataFrameDemos2.irisMadeleineInNantes()
        buildings = GeoDataFrameDemos2.irisMadeleineInNantesBuildings()
        roads = GeoDataFrameDemos2.irisMadeleineInNantesRoads()
        grid = GeoDataFrameDemos2.irisMadeleineInNantesINSEEGrid()

        # MAPPING
        fig, basemap = plt.subplots(figsize=(1 * 8.26, 1 * 8.26))
        # grid.plot(ax=basemap, column='Ind', alpha=0.95, legend=True)
        iris.boundary.plot(ax=basemap, color='red')
        buildings.plot(ax=basemap, color='grey', edgecolor='white')
        roads.plot(ax=basemap, color='black', linewidth=1)
        grid.boundary.plot(ax=basemap, color='green', linewidth=1)
        plt.show()
        plt.close(fig)
